import "./App.css";
import { useContext } from "react";
import { SocketContext } from "./contexts/socket";

function App() {
  const socket = useContext(SocketContext);
  socket.connect();
  return (
    <>
      <SocketContext.Provider value={socket}>
        <div className="App">
          <p>Hello World!</p>
        </div>
      </SocketContext.Provider>
    </>
  );
}

export default App;
